  return (
    <>
      <div className="flex items-center justify-center">
        <Sidebar />
        <main className="py-10 lg:pl-72">
          <div className="px-4 sm:px-6 lg:px-8">
            <TextInput />
          </div>
        </main>
      </div>
    </>
  );
};

export default Home;
